import React, {useEffect, useState} from 'react';

function User(props) {
  return (
    <React.Fragment>
        <div>{props.firstName}</div>
        <div>{props.lastName}</div>

        <Link to="/dashboard">Go to dashboard page</Link>

    </React.Fragment>

  )
}

export default User;
